import React, { useEffect, useState } from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle.min';
import AOS from 'aos';
import 'aos/dist/aos.css';
import carRental from '../../assets/car-rental.jpg';
import comfortableStays from '../../assets/comfortable-stays.jpg';
import dubaiBeauty from '../../assets/dubai-beauty.jpg';
import excitingAdventures from '../../assets/exciting-adventures.jpg';
import exploreGeorgia from '../../assets/explore-georgia.jpg';
import './Home.css';

const galleryImages = [
  { id: 1, src: exploreGeorgia, alt: 'Explore Georgia', className: 'large' },
  { id: 2, src: dubaiBeauty, alt: 'Beautiful Destinations', className: 'small' },
  { id: 3, src: comfortableStays, alt: 'Comfortable Stays', className: 'large' },
  { id: 4, src: excitingAdventures, alt: 'Exciting Adventures', className: 'medium' },
  { id: 5, src: carRental, alt: 'Car Rentals', className: 'small' },
];

const Home = () => {
  useEffect(() => {
    AOS.init({ duration: 1000 }); // Initialize AOS with a 1-second duration
  }, []);

  const [showMoreFAQ, setShowMoreFAQ] = useState(false);
  const [visibleAnswers, setVisibleAnswers] = useState([]);

  const faqQuestions = [
    { question: "What kind of clothes do I need to carry while traveling to Georgia?", answer: "You should carry clothes appropriate for the season. In winter, pack warm layers, and in summer, light clothes are sufficient, but it's always good to have a jacket for cooler evenings." },
    { question: "What is the best time to visit Georgia?", answer: "The best time to visit Georgia is between May and October when the weather is warm, and the landscapes are lush and green." },
    // Add more FAQ questions as needed...
  ];

  const toggleAnswer = (index) => {
    setVisibleAnswers((prevVisibleAnswers) => {
      const updatedVisibleAnswers = [...prevVisibleAnswers];
      updatedVisibleAnswers[index] = !updatedVisibleAnswers[index];
      return updatedVisibleAnswers;
    });
  };

  const toggleShowMoreFAQ = () => {
    setShowMoreFAQ(!showMoreFAQ);
  };

  return (
    <div className="content">
      {/* Carousel Section */}
      <div id="carouselExampleIndicators" className="carousel slide" data-bs-ride="carousel" data-bs-interval="3000">
        <div className="carousel-indicators">
          {galleryImages.map((_, index) => (
            <button
              key={index}
              type="button"
              data-bs-target="#carouselExampleIndicators"
              data-bs-slide-to={index}
              className={index === 0 ? "active" : ""}
              aria-current={index === 0 ? "true" : "false"}
              aria-label={`Slide ${index + 1}`}
            ></button>
          ))}
        </div>
        <div className="carousel-inner">
          {galleryImages.map((image, index) => (
            <div className={`carousel-item ${index === 0 ? "active" : ""}`} key={image.id} data-aos="fade-up">
              <img src={image.src} className="d-block w-100" alt={image.alt} />
              <div className="carousel-caption d-none d-md-block">
                <h5 data-aos="fade-down">{image.alt}</h5>
                <p data-aos="fade-up">Explore the amazing beauty of {image.alt}.</p>
              </div>
            </div>
          ))}
        </div>
        <button className="carousel-control-prev" type="button" data-bs-target="#carouselExampleIndicators" data-bs-slide="prev">
          <span className="carousel-control-prev-icon" aria-hidden="true"></span>
          <span className="visually-hidden">Previous</span>
        </button>
        <button className="carousel-control-next" type="button" data-bs-target="#carouselExampleIndicators" data-bs-slide="next">
          <span className="carousel-control-next-icon" aria-hidden="true"></span>
          <span className="visually-hidden">Next</span>
        </button>
      </div>

      {/* Gallery Section */}
      <section className="gallery py-5">
        <div className="container">
          <h2 className="text-center mb-4" data-aos="fade-right">Top Tourism Places in Georgia</h2>
          <div className="gallery-grid">
            {galleryImages.map((image) => (
              <div className={`gallery-item ${image.className}`} key={image.id} data-aos="zoom-in">
                <img src={image.src} alt={image.alt} className="img-fluid" />
                <div className="overlay">
                  <h4 data-aos="fade-up">{image.alt}</h4>
                </div>
              </div>
            ))}
          </div>
        </div>
      </section>

      {/* FAQ Section */}
      <section className="faq py-5">
        <div className="container">
          <h2 className="text-center mb-4" data-aos="fade-left">Frequently Asked Questions</h2>
          <div className="accordion" id="faqAccordion">
            {faqQuestions.map((faq, index) => (
              <div className="accordion-item" key={index} data-aos="flip-up">
                <h2 className="accordion-header" id={`heading${index}`}>
                  <button
                    className="accordion-button"
                    type="button"
                    data-bs-toggle="collapse"
                    data-bs-target={`#collapse${index}`}
                    aria-expanded={visibleAnswers[index] ? "true" : "false"}
                    aria-controls={`collapse${index}`}
                    onClick={() => toggleAnswer(index)}
                  >
                    {faq.question}
                  </button>
                </h2>
                <div
                  id={`collapse${index}`}
                  className={`accordion-collapse collapse ${visibleAnswers[index] ? 'show' : ''}`}
                  aria-labelledby={`heading${index}`}
                  data-bs-parent="#faqAccordion"
                >
                  <div className="accordion-body">
                    {faq.answer}
                  </div>
                </div>
              </div>
            ))}
          </div>
          <div className="text-center mt-4">
            <button className="btn btn-primary" onClick={toggleShowMoreFAQ} data-aos="fade-up">
              {showMoreFAQ ? "Show Less" : "See More"}
            </button>
          </div>
        </div>
      </section>
    </div>
  );
};

export default Home;
